this.options = {
  // root_mode: "survival",
  root_mode: "team",
  map_size: 60,
  // map_size: 100,
  crystal_value: 6,
  asteroids_strength: 0.1,
  station_crystal_capacity: 0.25,
  station_size: 3,
  station_regeneration: 0.25,
  all_ships_can_dock: true,
  friendly_colors: 2,
  ships: ships,
  radar_zoom: 1,
  strafe: 0.5
};

var amount = 1;
var tp_rate = 1800;

this.tick = function(game) {
  amount = Math.ceil(game.step / 10000);
  if (amount > 25) {
    amount = 25;
  }
  if (game.step > 500 && game.step % 5 === 0) {
    // var arr = [10, 11, 14, 16, 17, 18]; // alien
    var arr = [10] // chicken
    var arr2 = [10, 11, 20, 21, 12]; // collectible
    var alien_code = arr[Math.floor(Math.random() * arr.length)];
    if (game.aliens.length < amount) game.addAlien({code: alien_code, level: Math.floor(Math.random() * 4), crystal_drop: 200, weapon_drop: arr2[Math.floor(Math.random() * arr2.length)]});
    for (let i = 0; i < game.aliens.length; i++) {
      var alien = game.aliens[i];
      if (i > 0) alien.set({x: game.aliens[0].x, y: game.aliens[0].y, vx: 0, vy: 0});
      alien.set({rate: 10, damage: amount * 10, laser_speed: 250});
    }
    
    if (game.step % tp_rate === 0) {
      echo("TP ALIEN, RATE IS " + tp_rate);
      tp_rate -= 50;
      if (tp_rate < 30) {
        tp_rate = 30;
      }
      game.aliens[0].set({x:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * game.options.map_size * 5, y: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * game.options.map_size * 5});
      game.addAsteroid({size: Math.round(Math.random()) * 50,x:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * game.options.map_size * 5, y: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * game.options.map_size * 5, vx:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * 2, vy: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * 2});
    }
    
    if (game.step % 720 === 0) {
      for (let i = 0; i < 50; i++) {
        game.addCollectible({code: arr2[Math.floor(Math.random() * (arr2.length - 1))], x:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * game.options.map_size * 5, y: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * game.options.map_size * 5});
      }
    }
    
    if (game.step === 72000) {
      game.addAlien({code:20});
      for (let ship of game.ships) {
        ship.instructorSays("FINAL BOSS SPAWNED!");
      }
    }
    
    // game.addCollectible({code:12,x:game.ships[0].x,y:game.ships[0].y})
    
    // game.ships[0].set({invulnerable:500})
    // game.aliens[0].set({x:game.ships[2].x, y:game.ships[2].y})
  }
}
